import App from './App';
import React from 'react';
import ReactDOM from 'react-dom/client';
import '../src/assets/css/bootstrap.min.css';
import '../src/assets/css/animate.min.css';
// import '../src/assets/css/javascript-plugins-bundle.css';
import '../src/assets/css/menuzord.css'
import '../src/assets/css/style-main.css';
import '../src/assets/css/menuzord-rounded-boxed.css';
import '../src/assets/css/responsive.css';
import '../src/assets/css/theme-skin-color-set1.css';


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
